import React from "react";
import "../App.css";

function Footer() {
  return (
    <footer className="page-footer font-small fixed-bottom text-white">
      <div className="footer-copyright text-center py-3 float-left">
        Contacto: correo@prueba.com
      </div>
    </footer>
  );
}
export default Footer;
